import React from 'react';
function LiveSearch(props) {
    return ( 
        <>
         <div className="liveSuggestions card">
            {
                props.arr.map((prd)=>{
                    <div className="row">
                        <tr>
                    <td><img src={prd.photograph} className="bRd5" style={{width:"50px",height:"50px"}} alt="" /></td>
                    <td>{prd.name}</td>
                    <td>{prd.price}</td>
                    </tr></div>
                })
            }

            </div>
            </>
     );
}

export default LiveSearch;
